import React, {useState} from 'react';
import CurrentSong from './components/CurrentSong';
import AddSong from './components/AddSong';
import FullList from './components/FullList';

export default function App(){  
  const [display, setDisplay] = useState(false)
  const [numSongs, setNumSongs] = useState(0)
  const [allSongs,updateAllSongs] = useState([])

  return(
    <>
      <CurrentSong />
      <AddSong setDisplay={setDisplay} updateAllSongs = {updateAllSongs} setNumSongs = {setNumSongs}/>
      <FullList allSongs = {allSongs} updateAllSongs = {updateAllSongs} display = {display} setDisplay={setDisplay} setNumSongs = {setNumSongs}/>
    </>
  )
}
